// 热力图数据
var convertData = function (data) {
    var res = [];
    for (var i = 0; i < data.length; i++) {
        var geoCoord = geoCoordMap[data[i].name];
        if (geoCoord) {
            res.push({
                name: data[i].name,
                value: geoCoord.concat(data[i].value)
            });
        }
    }
    return res;
};
var data = convertData(data_mass);

function generateLines(lonStart, lonEnd, latStart, latEnd, step) {
    var lines = [];
    for (var lon = lonStart; lon <= lonEnd; lon += step) {
        lines.push({
            coords: [[lon, latStart], [lon, latEnd]],
            label: `${lon}°E` // Label for longitude
        });
    }
    for (var lat = latStart; lat <= latEnd; lat += step) {
        lines.push({
            coords: [[lonStart, lat], [lonEnd, lat]],
            label: `${lat}°N` // Label for latitude
        });
    }
    return lines;
}

