var continent_currentId = 0;
const cntId = 3;
const innerHtmlList = ["地图显示：质量", "地图显示：年份", "地图显示：数量"];
function ToggleMap() {
    // console.log("---",continent_currentId);
    continent_currentId = (continent_currentId + 1) % cntId;
    // console.log("+++",continent_currentId,"\n");
    ChangeOption(continent_currentId);
    myChart.setOption(option);
    myChart2.setOption(option);
    document.getElementById('toggleHeatMap').innerHTML = innerHtmlList[continent_currentId];
}
// 点击切换热力图展示内容（年份 / 密度 / 数量）
document.getElementById('toggleHeatMap').addEventListener("click", function(){
    ToggleMap();
});


// 监听按钮点击事件，用于切换视角
continent_list = ["NorthAmerica", "SouthAmerica", "Europe", "Asia", "Africa", "Oceania", "World"];
map_center_list = [[-105,45],[-60,-15],[15,45],[110,45],[20,4],[135,-25],[0,0]];
map_zoom_list = [3.6, 3.6, 4.8, 2.5, 3.3, 4.5, 1];
function changeId(id) {
    document.getElementById("current_continent_id").innerHTML = id; //通过innerHTML记录当前选择的大洲
    // 切换世界地图的焦点
    option.geo.center = map_center_list[id];
    option.geo.zoom = map_zoom_list[id];
    myChart.setOption(option);
    myChart2.setOption(option);
}
document.getElementById(continent_list[0]).addEventListener("click", function(){
    changeId(0);
});
